import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./css/nav.css";
function Nav() {
  return (
    <div className="dropdown">
      <button onClick={toggleDropdown} className="dropbtn">
        Dropdown
      </button>
      {isOpen && (
        <div className="dropdown-content">
          <a href="#">Link 1</a>
          <a href="#">Link 2</a>
          <a href="#">Link 3</a>
        </div>
      )}
    </div>
  );
}
export default Nav;
